    alert(`Reduce has been clicked`)
  }
  return (
    <div className="App">
     <h1>Counter 0</h1>
     <button onClick={add}>ADD</button>
     <button onClick={reduce}>REDUCE</button>
    </div>
  );
}

export default App;
